import React, { useState, useEffect } from "react";
import axios from "axios";
import ClothingImageCard from "../components/ClothingImageCard";

const ShirtPage = () => {
  const [shirts, setShirts] = useState([]);

  useEffect(() => {
    const fetchShirts = async () => {
      const response = await axios.get("http://localhost:3001/clothes");
      setShirts(response.data.filter((item) => item.clothingtype === "shirt"));
    };
    fetchShirts();
  }, []);

  return (
    <div>
      <h1>Shirts</h1>
      {shirts.map((shirt) => (
        <ClothingImageCard
          key={shirt.id}
          clothingType={shirt.clothingtype}
          image={shirt.image}
        />
      ))}
    </div>
  );
};

export default ShirtPage;
